import React from 'react';
import Container from 'react-bootstrap/Container';

function Banner() {
  return (
    <header style={{ paddingLeft: 0 }}>
      <div
        className='p-5 bg-image'
        style={{ backgroundImage: "url('/images/intro_bg.jpg')" }}
      >
        <Container>
            <div className='mask text-start text-white posito'>
                <p className='mb-3'>A Web Agency For</p>
                <h2 className='mb-3'>Design & Development Experiences</h2>
                <a className='btn btn-outline-light btn-lg' href='#!' role='button'>
                    Our Services
                </a>
                <a className='btn btn-outline-light btn-lg ms-2' href='#!' role='button'>
                    Contact Us
                </a>
            </div>
        </Container>
      </div>
    </header>
  );
}

export default Banner;
